DROP TABLE A4GD_MAPPING_AGS;
CREATE TABLE A4GD_MAPPING_AGS AS SELECT NXTNBR.NEXTVAL AS ID, SCO_CLASSE, DE_CLASSE, SCO_SOTTO_CLASSE, DE_SOTTO_CLASSE, ID_TIPO_MACCHINA, DE_MACCHINA, ID_MACCHINA, (SELECT ID FROM A4GD_TIPOLOGIA T WHERE T.DESCRIZIONE = M.TIPOLOGIA) AS ID_TIPOLOGIA, M.TIPOLOGIA, (SELECT F.ID FROM A4GD_CLASSE_FUNZIONALE F JOIN A4GD_TIPOLOGIA T ON F.ID_TIPOLOGIA = T.ID WHERE F.DESCRIZIONE = M.CLASSE_FUNZIONALE AND T.DESCRIZIONE = M.TIPOLOGIA) AS ID_CLASSE_FUNZIONALE, M.CLASSE_FUNZIONALE, (SELECT S.ID FROM A4GD_SOTTOTIPO S JOIN A4GD_CLASSE_FUNZIONALE F ON S.ID_CLASSE_FUNZIONALE = F.ID JOIN A4GD_TIPOLOGIA T ON F.ID_TIPOLOGIA = T.ID WHERE M.SOTTOTIPO = S.DESCRIZIONE AND M.CLASSE_FUNZIONALE = F.DESCRIZIONE AND M.TIPOLOGIA = T.DESCRIZIONE ) AS ID_SOTTOTIPO, M.SOTTOTIPO FROM TMP_MAPPING_MACCHINE M;
commit;

UPDATE A4GD_MAPPING_AGS m
SET m.ID_CLASSE_FUNZIONALE = (SELECT cf.ID FROM A4GD_CLASSE_FUNZIONALE cf
	WHERE m.ID_CLASSE_FUNZIONALE IS NULL AND cf.ID_TIPOLOGIA = m.ID_TIPOLOGIA AND cf.DESCRIZIONE = m.CLASSE_FUNZIONALE
)
WHERE m.ID_CLASSE_FUNZIONALE IS NULL;

			UPDATE A4GD_MAPPING_AGS m
			SET m.ID_SOTTOTIPO = (SELECT st.ID FROM A4GD_SOTTOTIPO st
				WHERE m.ID_SOTTOTIPO IS NULL AND m.ID_TIPOLOGIA = st.ID_TIPOLOGIA AND m.ID_CLASSE_FUNZIONALE = st.ID_CLASSE_FUNZIONALE AND m.SOTTOTIPO = st.DESCRIZIONE
			)
			WHERE m.ID_SOTTOTIPO IS NULL;

			UPDATE A4GD_MAPPING_AGS m
			SET m.ID_SOTTOTIPO = (SELECT st.ID
			FROM A4GD_SOTTOTIPO st
			WHERE st.ID_CLASSE_FUNZIONALE = (SELECT cf.ID
			FROM A4GD_CLASSE_FUNZIONALE cf
			WHERE cf.ID_TIPOLOGIA = (SELECT t.ID FROM A4GD_TIPOLOGIA t WHERE t.DESCRIZIONE = 'TRATTRICI AGRICOLE')
			)
			AND st.DESCRIZIONE = 'TRATTRICE TELAIO ARTICOLATO QUATTRO RUOTE MOTRICI'
			)
			WHERE m.ID_SOTTOTIPO IS NULL AND m.SOTTOTIPO = 'TRATTRICE TELAIO ARTICOLATO QUATTRO RUOTE MOTRICI' AND m.TIPOLOGIA = 'TRATTRICI AGRICOLE' AND m.CLASSE_FUNZIONALE = 'FORZA MOTRICE';
